    const fetchUser = async () => {
      const res = await axios.get(`/user?username=${id}`);
      console.log(res.data);
    };
    fetchUser();
  }, []);

  return (
    <>
      <div>UsrePage</div> <span>{id}</span>
    </>
  );
}
